import React from 'react'

function Admin() {

  const navigate = useNavigate
  const logout=()=>{
    localStorage.removeItem('token')
    localStorage.removeItem('user')
  }
  return (
    <div>
      <button class='btn'>logout</button>
    </div>
  )
}

export default Admin
